import { NgModule } from '@angular/core';
import { Routes, RouterModule } from '@angular/router';

import { RecipeScreenPage } from './recipe-screen.page';

const routes: Routes = [
  {
    path: '',
    component: RecipeScreenPage
  }
];

@NgModule({
  imports: [RouterModule.forChild(routes)],
  exports: [RouterModule],
})
export class RecipeScreenPageRoutingModule {}
